import React from 'react';
import ReactDOM from 'react-dom';
import Lic from './lic_page';
//import Global from '../App';

class Home extends React.Component {

  lic_page = () => {

   ReactDOM.render(<Lic />, document.getElementById('door'));
   var global = document.getElementById('global');
//   global.style.background = "#67a5ad";

  }

  render() {

    return (
     <div id="home_page">
      <div id="header_info">
        <div id="lic_ruch">
           <span id="ruch">23350565621</span><br></br>
           <span>Ковальчук Нина Александровна</span><br></br>
           <span>ул.Шекспира 1\8</span>
        </div>
        <hr/>
        <div id="kil_osib">
          <span>Колличество чел.</span>
          <p>1</p>
        </div>
        <div id="type_rozrah">
          <span>Тип расчета</span>
          <p>счетчик</p>
        </div>
        <hr/>
        <div id="service_one">
            <span>Водоподача</span>
            <p>12.09</p>
        </div>
        <div id="service_two">
            <span>Водоотвод</span>
            <p>23.09</p>
        </div>
        <hr/>

      </div>
      <div id="block_buttons">


      </div>
         <button onClick={this.lic_page} id="lic_button">click me</button>
     </div>
    );
  }

}

export default Home;
